import React from 'react';
import './styles/styles.css';
import Logo from '../../assets/images/logo.png';

function Login() {
    return (
        
        <div className='login'>
            <img  src={Logo}/>
            <button>LOGIN WITH SPOTIFY</button>
        </div>
    )
}

export default Login
